    [],nt"revision_timestamp": "2015-05-07T03:51:50.274079",nt"name": "aeroelastic-aeroservoelastic-uncertainty-and-reliability-of-advanced-aerospace-vehicles-in",nt"isopen":
    true,nt"url": null,nt"notes": "ASSURE - Aeroelastic / Aeroservoelastic
    (AE/ASE) Uncertainty and Reliability Engineering capability - is a set of probabilistic
    computer programs for isolating uncertainties in simulation, manufacturing, test,
    measurement, and test to analysis correlation affecting the AE/ASE characteristics
    of advanced flight vehicles in flight and on the ground, and for studying the effects
    of such uncertainties.  ASSURE will provide a quantitative assessment of the statistics
    of AE/ASE stability and dynamic response of aircraft at given flight conditions,
    throughout the flight envelope, on the runway, and throughout the aircraft fleet
    and its missions.  It is designed to have significant flexibility in the types of
    problems analyzed, the solution methods used, and how problems are defined.  ASSURE
    will be unique in the scope of problems tackled, systems complexity involved, and
    the inclusion of all elements affecting the ASE behavior of flight vehicles; including
    detailed models of structures, aerodynamics, sensors, actuators, control systems,
    landing gear, and flight operations and maintenance procedures.  Uncertainties of
    the undamaged and damaged / repaired systems (structural, actuator, sensor, control
    computer, and landing gear, including possible aerodynamic consequences of damage)
    will be covered, with applications to test planning and analysis, design, certification,
    and fleet operation and maintenance.",nt"license_title": "U.S. Government
